games.forEach(async game => {
  var gameEl = document.createElement("div");

  gameEl.innerHTML = `
            <div class="card" style="display: flex">
              <h2>${game.title}</h2>
              <div class="outer">
                <img src="${game.image}" class="cardimg">
              </div>
            </div>
        `;
  
  if (game.type == "launch") {
    try {
      await registerSW();
    } catch (err) {
      error.textContent = "Failed to register service worker.";
      errorCode.textContent = err.toString();
      throw err;
    }
    document.getElementById("root").appendChild(gameEl);
    gameEl.addEventListener("click", () => {
      window.location.replace(location.origin + __uv$config.prefix + __uv$config.encodeUrl(game.url));
    });
  } else {
    document.getElementById("root").appendChild(gameEl);
    gameEl.addEventListener("click", () => {
      window.location.replace(game.url);
    });
  }
});